import ChartsEmbedSDK from '@mongodb-js/charts-embed-dom';


const sdk = new ChartsEmbedSDK({
  baseUrl: 'https://charts.mongodb.com/charts-mars-rover-uovew'
});

const chart = sdk.createChart({ chartId: '922f002a-f42a-4469-8d4b-7fc23b8a0f0b' }); 
//chart.render(document.getElementById('chart'));

export default function Dashboard() {

//document.getElementById("refresh").addEventListener("click", () => {
//  chart.refresh();
//})

const renderChart = useCallback(async (ref) => {
    try {
      await chart.render(ref);
    } catch (e) {
      console.error(e);
    }
  }, []);

  return (
    <>
      <header className="header">
        <h1>Building timeline charts with Charts Embedding SDK (MongoDB)</h1>
      </header>

      <div className="charts">
        <div id="barChart" ref={setRefBarChart}></div>
        <div id="geoChart" ref={setRefGeoChart}></div>
      </div>
    </>
  );
}
